import pizzaDB from "./pizzaDB";
import Pizza from "./components/pizza"

export default function Home() {
  return (
    <div>
      <div className="row">
        {pizzaDB.map((pizza) => {
          return <div className="col-md-6 p-4"> 
            <div> 
              <Pizza pizza={pizza}/>
            </div>
          </div>;
        })}
      </div>
    </div>
  );
}
